import React from "react"



function Navbar(props){
  let n=1;
  let i=0;
  console.log(props.ne)
  props.ne==="zero" ? n++ : (props.ne==="yes" ? n+=1 : props.ne==="no"? n : n)
  console.log(n)

var x=()=> {
  if (props.ne==="zero"){
    i++;
  }
  n=Math.round(i/2)
  return n
}
    return <nav class="navbar navbar-expand-lg navbar-light bg-light">
      <a class="navbar-brand" href="#">
        <img class="img"src="data:image/png;base64," alt="" />
      </a>
        <div class="navbar-nav">
           <h3><span class="badge rounded-pill bg-primary" >{x}</span></h3> 
      
          <a class="nav-item nav-link active" href="#">Items</a>
        </div>
    </nav>
}


export default Navbar
